  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Morton National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1959.
  The report begins by summarizing the weather conditions, habitat conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, raptors, fish, and reptiles- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. The public relations section of the report describes recreational uses
  and Refuge visitors. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
